/*Table structure for table `zj_title_info` */

DROP TABLE IF EXISTS `zj_title_info`;

CREATE TABLE `zj_title_info` (
  `title_id` int(5) NOT NULL AUTO_INCREMENT COMMENT '题目id',
  `title_name` text NOT NULL COMMENT '题目',
  `class_id` int(5) DEFAULT NULL,
  `subject_id` int(5) NOT NULL COMMENT '科目id',
  `title_type` int(3) NOT NULL COMMENT '难度系数',
  `title_fraction` int(5) NOT NULL COMMENT '分数',
  `title_answer` text NOT NULL COMMENT '答案',
  `title_status` int(2) NOT NULL COMMENT '0单选题（a,b,c,d,e,f）  1 填空（0对 1错） 2主观',
  `choice1` text COMMENT '选项A',
  `choice2` text COMMENT '选项B',
  `choice3` text COMMENT '选项C',
  `choice4` text COMMENT '选项D',
  `user_id` varchar(50) DEFAULT NULL COMMENT '出题人id',
  `user_name` varchar(50) DEFAULT NULL COMMENT '出题人姓名',
  `create_time` varchar(20) DEFAULT NULL,
  `update_time` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`title_id`)
