  `is_delete` int(2) NOT NULL DEFAULT '0' COMMENT '是否删除 0 否  1是',
  `create_time` varchar(20) DEFAULT NULL COMMENT '开始时间',
  `update_time` varchar(20) DEFAULT NULL COMMENT '结束时间',
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4;

